import React from "react";
import "../components/pagesCss/Home.css";
import "../components/pagesCss/GeneralPageCss.css";
import { options } from "../services/amazon-services";
import axios from "axios";

function Home() {
  const options = {
    method: "POST",
    url: "https://amazon-products-api.p.rapidapi.com/get-product-data",
    headers: {
      "content-type": "application/json",
      "X-RapidAPI-Key": "8e9d221530mshf5b0a61b3cb744fp1810e8jsn63c7e238a636",
      "X-RapidAPI-Host": "amazon-products-api.p.rapidapi.com",
    },
    data: '{"asin":"B08H75RTZ8","host":"www.amazon.com"}',
  };

  axios
    .request(options)
    .then(function (response) {
      console.log(response.data);
    })
    .catch(function (error) {
      console.error(error);
    });
  return <div className="container general-page">{options.Batteries}</div>;
}

export default Home;
